(()=>{document.getElementById("output");const e=document.getElementById("boxnumbers"),t=(document.getElementById("title"),document.querySelector("#cargoDiv")),n=(document.getElementById("emails"),document.getElementById("title"),document.createDocumentFragment(),[]);var m;window.addEventListener("load",(()=>{fetch("https://bitbucket.org/hpstore/spacex-cargo-planner/raw/204125d74487b1423bbf0453f4dcb53a2161353b/shipments.json").then((e=>e.json())).then((e=>{n.push(...e)})).catch((e=>console.log(e)))})),m=n,t.addEventListener("click",(t=>{t.target;let n=m.find((e=>e.name==t.target.innerText));document.getElementById("emails").innerHTML=n.email,document.getElementById("boxnumbers").value=n.boxes,document.getElementById("title").innerHTML=n.name;let o=e.value.split(",").map((e=>Number(e)));document.getElementById("output").innerHTML=function(e){let t=0;for(let n=0;n<e.length;n++)t+=e[n];return Math.ceil(t/10)}(o)}))})();